import React from "react";
import { Route, Redirect } from "react-router-dom";

export default function ClientRoute({
  component: Component,
  type: Type,
  ...rest
}) {
  return (
    <Route
      {...rest}
      render={(props) => {
        if (
          Type === "client" ||
          Type === "administrateur" ||
          Type === "moderateur"
        ) {
          return <Component {...props} type={Type} />;
        } else {
          return (
            <div>
              <Redirect
                to={{ pathname: "/", state: { from: props.location } }}
              />
              {console.log(Type)}
            </div>
          );
        }
      }}
    />
  );
}
